import React from 'react';
import './App.css';
import { makeStyles } from '@material-ui/core';
import CollectorDashboard from '../src/views/CollectorDashboard';
import { BrowserRouter as Router, Route} from 'react-router-dom';
import { ROLL_NUMBER } from '../src/utils/constants';
import NavbarComp from './components/Navbar';
import InvoiceTable from './components/table';
import Header3 from './components/usetable';

const useStyles = makeStyles((theme) => ({
  '@global': {
    '*::-webkit-scrollbar': {
      width: '0.4em',
      height: '0.4em',
    },
    '*::-webkit-scrollbar-track': {
      '-webkit-box-shadow': 'inset 0 0 6px rgba(0,0,0,0.00)',
    },
    '*::-webkit-scrollbar-thumb': {
      backgroundColor: '#6D7183',
      outline: '1px solid slategrey',
    },
  },
  mainBackground: {
    background: theme.palette.primary.main,
    height: '100vh',
    width: '100vw',
    overflow: 'hidden',
  },
  root: {
    flexGrow: 1,
  },
  paper: {
    height: 140,
    width: 100,
  },
}));
class App extends React.Component {
  // console.log('theme', theme);
  state={
    data:[],
    edit:[],
  }
  handleD=(e) =>{
    console.log("updated",e);
  }
  render(){
    const {classes} = useStyles();
      return (
        <div className={classes.mainBackground}>
          <Router basename={`/${ROLL_NUMBER}`}>
            <Route exact path="/" component={CollectorDashboard} />
            <NavbarComp />
              <Header3 />
              <InvoiceTable handleD= {this.handleD}/>
          </Router>
        </div>
      );
  }
}
export default App;
